import React from "react";

const NewTodo: React.FC = () => {
    return (
        <form>
            <div>
                <label htmlFor="todo-test">Todo Text</label>
                <input type="text" id="todo-text" />
            </div>
            <button type="submit"></button>
        </form>
    );
};

export default NewTodo;
